import React, { useEffect, useState } from 'react'
import "./NavBar.css"
import { NavLink } from "react-router-dom"
import axios from "axios"

const Dashboard = () => {
    const [userdata, setUserdata] = useState({});
    console.log("response", userdata)


    const getUser = async () => {
        try {
            const response = await axios.get("http://localhost:1000/login/sucess", { withCredentials: true });

            setUserdata(response.data.user)
        } catch (error) {
            console.log("error", error)
        }
    }



    useEffect(() => {
        getUser()
    }, [])
    return (
        <>




            <div className="profile" style={{backgroundColor:"white",color:"black",height:"100em"}}>
                
              
                    {
                        Object?.keys(userdata)?.length > 0 ? (
                            <>



                                <h1 style={{ color: "black", fontWeight: "bold" }}>{userdata?.displayName}</h1>
                                <h1 style={{ color: "black", fontWeight: "bold" }}>{userdata?.email}</h1>
                                <li>
                                    <img src={userdata?.image} style={{ width: "15em",height:"15em", borderRadius: "50%" }} alt="" />
                                </li>

                            </>
                        ) : <li>

                        </li>
                    }



                
            </div>

        </>
    )
}

export default Dashboard
